import React from 'react';
import Hero from './Hero';
import Brockerage from './Brockerage';
import OpenAccount from '../OpenAccount';
import Charges from './Charges';

function PricingPage() {
    return ( 
        <>
        <Hero />
        <OpenAccount />
        <Brockerage />
        <Charges />
        </>
     );
}

export default PricingPage;
